import React from 'react';
import { SimpleCard } from '../components/SimpleCard';

const VibeCardDemo: React.FC = () => {
  const handleButtonClick = () => {
    alert('Hello from the Vibe card!');
  };

  return (
    <div style={{ padding: '40px 20px', backgroundColor: '#f5f5f5', minHeight: '100vh' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '40px', color: '#333' }}>
        Vibe Design System Demo
      </h1>

      <SimpleCard
        title="Simple Card Example"
        description="This card demonstrates how to use Vibe components like Box, Heading, Text, and Button together to create a beautiful, consistent UI."
        buttonText="Try Me!"
        onButtonClick={handleButtonClick}
      />

      <SimpleCard
        title="Another Card"
        description="You can easily create multiple cards with different content while maintaining design consistency."
        buttonText="Click Here"
        onButtonClick={() => console.log('Second card clicked!')}
      />
    </div>
  );
};

export default VibeCardDemo;
